  "config" => "{"title":"Migraci\u00f3n Err\u00f3nea!","text":"Error en la hoja de \"Ideas\": Descripci\u00f3n de la idea de proyecto CON EL FIN DE REALIZAR UNA MEJORA DURANTE EL PROCESO DE SECADO SE QUIERE DESARROLLAR UN PROTOTIPO DE UN SECADOR SOLAR CON ALMACENAMIENTO DE CALOR Y MONITOREO DE DIVERSAS PROPIEDADES TALES COMO TEMPERATURA, HUMEDAD RELATIVA, RADIACI\u00f3N Y PESO, LAS CUALES EST\u00e1N PRESENTES EN EL PROCESO; MEDIANTE ESTO SE DESEA TENER CONTROL DE LAS PROPIEDADES QUE INFLUYEN EN EL PORCENTAJE DE CALIDAD DEL GRANO DE CAF\u00e9 Y EVALUAR LAS PRINCIPALES CARACTER\u00edSTICAS DE SECADO DEL CAF\u00e9, COMO EL TAMA\u00f1O, EL COLOR, EL AROMA Y LA TEXTURA. EL SECADO SOLAR ES UNO DE LOS M\u00e9TODOS M\u00e1S UTILIZADOS, ADEM\u00e1S DE SER ECON\u00f3MICO Y RESPETUOSO CON EL MEDIO AMBIENTE GARANTIZA QUE EL PRODUCTO CONSERVE SUS PROPIEDADES ORGANOL\u00e9PTICAS PARA EL ALMACENAMIENTO Y EL CONSUMO. PARA LA CONSTRUCCI\u00f3N SE TENDR\u00e1N EN CUENTA ALGUNOS FACTORES COMO EL LUGAR DONDE SE UBICAR\u00e1 LA SECADORA, LOS MATERIALES, LA CONSTRUCCI\u00f3N DEL TECHO, LA INSTALACI\u00f3N DEL PL\u00e1STICO, LA UBICACI\u00f3N DE LOS SENSORES DE TEMPERATURA, HUMEDAD, RADIACI\u00f3N SOLAR Y PESO. LAS CUALES EST\u00e1N PRESENTES EN EL PROCESO, MEDIANTE ESTO SE DESEA TENER CONTROL DE LOS FACTORES QUE INFLUYEN EN EL PORCENTAJE DE CALIDAD DEL GRANO DE CAF\u00e9 ESTA PROPUESTA SE DESEA IMPLEMENTAR EN UNA IMPORTANTE EMPRESA CAFICULTORA DE LA REGI\u00f3N DE NORTE DE SANTANDER LLAMADA COOPERACAFE. ESTO BENEFICIARA PARA LA CONSTRUCCI\u00f3N SE ANALIZARON ALGUNOS FACTORES COMO EL LUGAR DONDE SE UBICAR\u00e1 LA SECADORA, LOS MATERIALES, LA CONSTRUCCI\u00f3N DEL TECHO, LA INSTALACI\u00f3N DEL PL\u00e1STICO, LA UBICACI\u00f3N DEL COLECTOR Y LOS SENSORES DE TEMPERATURA, HUMEDAD, RADIACI\u00f3N SOLAR Y PESO INMERSA EN ESTE PROCESO EL CUAL VA A PERMITIR CUANTIFICAR CON EL FIN DE AUMENTAR LA EFICIENCIA ENERG\u00e9TICA DEL TECNOPARQUE NODO OCA\u00f1A SE PLANTEA IMPLEMENTAR UN BANCO DE PANELES SOLARES Y UN CONTROL BASADO EN DOS TIPOS DE CONFIGURACIONES, EL MODO UPS EL CUAL SE DEFINE COMO SISTEMA ININTERRUMPIDO DE ENERG\u00edA CUANDO HAY APAGONES Y EL MODO AHORRO DE ENERG\u00edA EL CUAL PROPONE ABASTECER ALGUNOS LUGARES DEL TECNOPARQUE CON EL FIN DE REDUCIR LOS COSTOS ENERG\u00e9TICO. ESTE PROYECTO NO SOLO BENEFICIA LOS COSTOS ENERG\u00e9TICOS DEL TECNOPARQUE DEBIDO A QUE ES UN SISTEMA BASADO EN ENERG\u00edAS RENOVABLES LO CUAL INFLUYE Y FAVORECE MUCHO EL AMBIENTE, TODA LA POBLACI\u00f3N DE OCA\u00f1A Y DE COLOMBIANA QUE NOS ESTAMOS VIENDO AFECTADOS POR LAS CONSECUENCIAS DEL CAMBIO CLIM\u00e1TICO, POR LA ALTA CONTAMINACI\u00f3N DE HIDROCARBUROS Y DEM\u00e1S FUENTES ENERG\u00e9TICAS NO RENOVABLES. OTRO FACTOR IMPORTANTE ES LA DE MEJORAR LA SEGURIDAD PARA EL CONTROL DE INGRESO DE LAS PERSONAS A LAS INSTALACIONES, YA QUE ESTA CUENTA CON UNA GRAN CANTIDAD DE MAQUINARIA Y COMPONENTES DE ALTO VALOR ECON\u00f3MICO. POR TAL RAZ\u00f3N SE PRETENDE ADECUAR AL SISTEMA LA TECNOLOG\u00edA RFID, LA CUAL UTILIZA TARJETAS CON C\u00f3DIGOS QUE ENV\u00edAN SE\u00f1ALES POR RADIOFRECUENCIA QUE AL ESTAR CERCA DE UN LECTOR REALIZAN LA IDENTIFICACI\u00f3N CONCEDIENDO EL ACCESO DEL PERSONAL ADMINISTRATIVO. en el registro de la fila #64 no debe ser mayor a 2000 car\u00e1cteres.","showConfirmButton":true,"type":"error","confirmButtonText":"Ok","confirmButtonColor":"#3085d6","allowOutsideClick":false}"
